Комиссия принимает решение об отклонении заявки участника отбора в следующих случаях:
несоответствие участника отбора критериям, установленным пунктами 31 или 32 Правил;
несоответствие  представленной  участником  отбора  заявки  положениям,  установленным
пунктами 3 и 4 настоящих Правил;
недостоверность  представленной  участником  отбора  информации,  в  том  числе  информации  о
его месте нахождения и адресе;
подача участником отбора заявки после даты и (или) времени, определенных для подачи заявок.
